import React from "react";

export default function search() {
    return (
        <div className="search">
            <form name="searchBox" target="http://www.google.com" method="GET">
                <input type="text" placeholder="Search for a movie" className="searchbar" id="searchbar" />
                <input type="submit" hidden />
            </form>
        </div>
    );
}
